import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateTimePickerMulti,
    OwpPageCarded,
    OwpSearchHeader,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpToolbar,
    OwpTreeGrid,
    OwpSearchAutoComplete,
} from 'owp/wrapper';
import * as TGEvent from 'owp/TGEvent';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }


    render() {
        return (
            <React.Fragment>
                <OwpPageCarded
                    header={
                        <OwpSearchHeader url="listOwpProdplan">
                            <div className="w-full">
                                <div className="flex mb-16">
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm03'}
                                        name={'sm03'}
                                        label={'제품명'}
                                        
                                    />
                                    <OwpSearchDateTimePickerMulti
                                        name="sm02"
                                        initNow={true} // TODO: true 인 경우 현재 시로 init (* default = false)
                                        labels={{ start: ' 인수시작일', end: '종료일' }}
                                        inputProps={{ start: { style: { width: 140 } }, end: { style: { width: 140 } } }}
                                        required={true}
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'제품배치번호'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm04'}
                                        name={'sm04'}
                                        label={'Lot번호'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm04'}
                                        name={'sm04'}
                                        label={'인수번호'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm04'}
                                        name={'sm04'}
                                        label={'물질명'}
                                        
                                    />
                                </div>
                                <div className="flex">
                                    <OwpSearchSelectField
                                        className="w-160"
                                        id={'sm05'}
                                        name={'sm05'}
                                        label="물질 ID"
                                        useAll
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm04'}
                                        name={'sm04'}
                                        label={'APP'}
                                        
                                    />
                                </div>
                            </div>
                        </OwpSearchHeader>
                    }
                    contentToolbar={
                        <OwpToolbar title="라벨(인수번호) 매핑관리">
                            {/* 
                            <OwpButton color={'secondary'} variant={'outlined'}>
                            출력
                            </OwpButton> */}
                        </OwpToolbar>
                    }
                    content={
                        <React.Fragment>
                            <OwpTreeGrid
                                id="C0206000"
                                LayoutUrl={'/assets/data/C0206000Def.xml'}
                                DataUrl={'/assets/data/C0202000Data.xml'}
                            />
                        </React.Fragment>
                    }
                    innerScroll
                />
            </React.Fragment>
        );
    }
}

export default Page;
